import React from "react";

export default function Contact() {
  return (
    <main>
          <form>
               <input type="email" placeholder="Email" required={true}/>
               <input type="text" />
               <textarea name="" id="" cols="60" rows="10" required={true}>

               </textarea>
               <button type="submit">Send</button>         
          </form>
    </main>
  );
}
